import React from 'react';


export default class Sign extends React.Component{
    render(){
        return (<div>

        <ul>
            <li>
                <Link to="/">Home</Link>
            </li>
                                                
        </ul>
            <Route path="/" exact render={()=>{return <h1>have been routed</h1>}}/>
            <h1>Sign Up</h1>
            </div>);
    }
}
